import React, { useState } from 'react'

function AppointmentDetail({ message, isOpen, onClose }) {

  const [message2, setMessage2] = useState('Hello')

  const MODAL_STYLES = {
    position: 'fixed',
    top: '50%',
    left: '50%',
    transform: 'translate(-50%, -50%)',
    backgroundColor: '#FFF',
    padding: '50px',
    zIndex: 1000,
    backgroundColor: 'red'
  }

  if (!isOpen) return null

  return (
    <div>
      <div style={MODAL_STYLES}>
        {message}
        {/* {message2} */}
        <button onClick={onClose}>
          Close me!
        </button>
      </div>
    </div>
  )
}

export default AppointmentDetail
